import "./App.css";
import Header from "./components/Header/Header";
import Hero from "./components/UI/Hero";
import Counter from "./components/UI/Counter";
import Services from "./components/UI/Services";
import About from "./components/UI/About";


function App() {
  return (
    <>
      <Header />
      <Hero />
      <Counter />
      <Services />
      <About />
    </>
  );
}

export default App;
